import React from 'react';
import { Link } from 'react-router-dom';

const HomePage = () => {
  return (
    <div>
      <header className="bg-brown-700 text-beige-100 p-4 flex justify-between">
        <div className="flex space-x-4">
          <Link to="/login" className="text-beige-100 hover:text-beige-300">Login</Link>
          <Link to="/register" className="text-beige-100 hover:text-beige-300">Register</Link>
        </div>
      </header>
      <main className="p-8 bg-beige-100">
        <h1 className="text-4xl font-bold mb-4 text-brown-700">Welcome to chocofete</h1>
        <p className="text-lg text-brown-600">
          Chocolate is one of the most popular food types and flavors in the world, and many foodstuffs involving chocolate exist, particularly desserts, including cakes, pudding, mousse, chocolate brownies, and chocolate chip cookies. Many candies are filled with or coated with sweetened chocolate.
        </p>
      </main>
    </div>
  );
};

export default HomePage;
